long_desc.thetext:
Currently in framework qx.io.ImageLoader class, when image loaded, checking for whether image is available will be triggered, code in image loader line 289 - 295 below:

      var isImageAvailable = function(imgElem) {
        return (imgElem && imgElem.height !== 0);
      };

      // [BUG #7497]: IE11 doesn't properly emit an error event
      // when loading fails so augment success check
      if (event.type === "load" && isImageAvailable(element))

In most of the situation, it works fine. But if imgElem's src attr is base 64 data url and this data url is generated from svg string, in this case, IE11 will set height of the imgEleme to 0, but actually, this imgElem is available and can be rendered correctly.

This problem leads problem below:
if we set src of an image to base64 string (generated from svg string), the first time image can be loaded correctly, but after the image loaded, image available checking will be executed and result is false, the result will be cached in line 311:

entry.failed = true;

so next time when we load this base64 svg data, in qx.ui.basic.Image class, line 728:

      if(!ImageLoader.isFailed(source)) {
        ImageLoader.load(source, this.__loaderCallback, this);
      } else {
        if (el != null) {
          el.resetSource();
        }
      }

We get cached failed result, source will be reset. 

To reproduce this problem, follow steps below:
1. set an image source to svg base64 data 1 (data file attached).
   image rendered correctly
2. set the image source to svg base64 data 2 (data file attached)
   image rendered correctly
3. set the image source to svg base64 data 1 again, this time image source
   will be reset by image class due to above reasons

Possible solution to resolve this issue: check whether browser is IE and image source start with "data:image/svg+xml", if so, just return true in the checking

line 289 -- 291 in ImageLoader:

      var isImageAvailable = function(imgElem) {
        return (imgElem && imgElem.height !== 0);
      };

changed to

      var isImageAvailable = function(imgElem) {
		if (qx.core.Environment.get("browser.name") === "ie"
	            && imgElem.src.indexOf("data:image/svg+xml") > -1) {
			return true;
		}

        return (imgElem && imgElem.height !== 0);
      };

I also attached original svg file, please verify it.

Thanks very much and regards!

To incease performance, it's better change to:

var isImageAvailable = function(imgElem) {
        if (qx.core.Environment.get("browser.name") === "ie"
                && imgElem.src.substr(0, 18) === "data:image/svg+xml") {
            return true;
        }

        return (imgElem && imgElem.height !== 0);
      };
